def CV(causal_effects):
    """
    return: coefficient of variability
    """
    coefficient_variability = np.std(causal_effects) / np.mean(causal_effects)
    return coefficient_variability

def relative_diff(causal_effects):
    thres = 0.1
    num = int(len(causal_effects)*thres)
    causal_effects.rank()

def distribution(result):

    diff = result['basic'] - result['basic_group']
    result['basic_group'] = result['basic']
    result['feature_ie_ave'] = [ie + diff for ie in result['feature_ie_ave']]
    neuron_ie_ave = []
    for layer_neuron_ie in result['neuron_ie_ave']:
        layer = [ie + diff for ie in layer_neuron_ie]
        neuron_ie_ave.append(layer)
    result['neuron_ie_ave'] = neuron_ie_ave

    basic = result['basic_group']
    feature_ie_ave = result['feature_ie_ave']
    print(len(feature_ie_ave))
    print("-->CV", CV(feature_ie_ave))
    top_feature_value = [[ie] for ie in feature_ie_ave if ie > basic]
    print(len(top_feature_value), len(top_feature_value) / len(feature_ie_ave))
    print("-->CV", CV(top_feature_value))

    neuron_ie_ave = result['neuron_ie_ave']
    import operator
    from functools import reduce
    neuron_ie_ave = reduce(operator.add, neuron_ie_ave)
    neuron_value = [ie for ie in neuron_ie_ave]
    print(len(neuron_value))
    print("-->CV", CV(neuron_value))
    # print("-->average difference", self.average_difference(neuron_value))
    top_neuron_value = [ie for ie in neuron_ie_ave if ie > basic]
    print(len(top_neuron_value), len(top_neuron_value) / len(neuron_value))
    print("-->CV", CV(top_neuron_value))
    # print("-->average difference", self.average_difference(top_neuron_value))

    ie_ave = [feature_ie_ave] + result['neuron_ie_ave']
    high_ie_ave = []
    for ie_list in ie_ave:
        high_ie_list = []
        for ie in ie_list:
            if ie > basic:
                high_ie_list.append(ie)
        high_ie_ave.append(high_ie_list)


    # plot average ie
    plt.figure()
    plt.ylabel('Causal Effect')

    color_tab = ['black', 'b', 'g', 'r', 'c', 'm']
    labels = ['attribute', 'layer_1', 'layer_2', 'layer_3', 'layer_4', 'layer_5']

    plt.axhline(basic, c="black", ls="--", label='baseline')
    idx = 0
    for i in range(0, len(high_ie_ave)):
        label = labels[i]
        for j in range(0, len(high_ie_ave[i])):
            if j == 0:
                plt.scatter(idx, high_ie_ave[i][j], color=color_tab[i], label=label)
            else:
                plt.scatter(idx, high_ie_ave[i][j], color=color_tab[i])
